import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { 
  BarChart3, 
  TrendingUp, 
  Award, 
  Clock, 
  Target,
  CheckCircle,
  Calendar,
  BookOpen,
  Star,
  Trophy
} from 'lucide-react';

const Progress = () => {
  const [selectedPeriod, setSelectedPeriod] = useState('week');

  const periods = [
